import React, {useState, useEffect} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const [json, setJson] = useState(1);

  useEffect(() => {
  fetch('/index').then(res =>
    console.log(res),

    res.json()).then(data => {
    console.log(data);
    setJson(data.map);
  });
}, []);

// console.log(data);
console.log(json);
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {json}
        </p>

      </header>
    </div>
  );
}

export default App;
